import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Login } from "./Login";
import { Chatbot } from "./Chatbot.js ";
const App = () => {
  return (
    <Router>
        <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Chatbot />} />
        </Routes>
    </Router>
  );
};

export default App;
